(	'BBKI82112-1029108702-20171-1',	'14101152610565',	'<p>Pesan verbal adalah semua jenis simbol yang menggunakan satu kata atau</p><p>lebih. Pesan verbal terdiri atas kata-kata terucap atau tertulis.</p><p>Pesan verbal terbagi atas 2 jenis yaitu :</p><p><br></p><ol><li>Fungsional yaitu alat yang dimiliki bersama untuk mengungkap gagasan</li><li>Formal yaitu rangkaian kata-kata yang disusun sesuai dengan tata bahasa.</li></ol>',	124),
(	'BBKI82112-1029108702-20171-1',	'14101152610565',	'<ol><li>Mengenal dunia di sekitar kita. Melalui bahasa kita mempelajari apa saja yang menarik minat kita, mulai dari sejarah suatu bangsa yang hidup pada masa lalu sampai pada kemajuan teknologi saat ini.</li><li>Berhubungan dengan orang lain. Bahasa memungkinkan kita bergaul dengan orang lain untuk kesenangan kita, dan atau mempengaruhi mereka untuk mencapai tujuan kita. Melalui bahasa kita dapat mengendalikan lingkungan kita, termasuk orang-orang di sekitar kita.</li><li>Untuk menciptakan koherensi dalam kehidupan kita. Bahasa memungkinkan kita untuk lebih teratur, saling memahami mengenal diri kita, kepercayaan-kepercayaan kita, dan tujuan-tujuan kita.</li></ol>',	125),
